#Step-1: store position of all 1s for every row
#Step-2: take intersection of every pair of rows (inter). Number of rectangles possible with end points in those rows equals interC2= inter*(inter-1)/2
class Solution(object):
    def countCornerRectangles(self, grid):

        if len(grid)==1 or len(grid[0])==1:
            return 0
        else:
            irow=[set() for x in range(len(grid))]
            
            for i in range(len(grid)):
                row= grid[i]
                for ite, ele in enumerate(row):
                    if ele==1:
                        irow[i].add(ite)
                
            ans= 0 
            for i in range(len(irow)-1):
                for j in range(i+1,len(irow)):
                    inter= len(set(irow[i]) & set(irow[j]))
                    ans+= 0 if inter<2 else inter*(inter-1)/2 
            
            return int(ans)


